import React, { Component } from 'react';
import '../styles/guest.css';

class guest extends Component{

    constructor() {
        super();
        this.state = {
            tasks: []
        };
        this.fetchTasks()
    }
    fetchTasks() {
        fetch('/guest')
          .then(res => res.json())
          .then(data => {
            this.setState({tasks: data});
          });
      }

    render(){
        return <div> 
        <Main/>
        <div class = "box"></div>
        <Search/>    
        <Carrousel tasks = {this.state.tasks} />
        </div>
    }
}

function Main(){
    return(
        <header>
        <div class="padre-sup">
            <div class="hijo-sup">
                <div class="logo-titulo">		
                    <h1 id="titulo-h"><a class="hipervinculo-h" href="/">TOTONET S.A</a></h1>
                </div>
                <nav id="menu-header">
                    <ul id="lista">
                        <a class="item hipervinculo-h" href="/login"><li> INICIAR SESION</li></a>
                    </ul>
                </nav>
            </div>
        </div>
        <div id="franja-amarilla-h"></div>  
    </header> 
    );
}

function Ifblock(props){
    return (
        <div class="card text-center" style={{backgroundImage: `url(${props.e.Imagen})`}}>
        <div class="title">
        <h2>{props.e.Puesto}</h2>
        </div>
        <div class="option">
            <ul>
